function pricees(dolar, btn1, btn2, htm) {
  dolar = +dolar
  let numbers = dolar
  let n = 1

  btn1.onclick = () => {
    numbers += dolar
    htm.innerHTML = numbers
    n += 1
    text.innerHTML = n
  }
  btn2.onclick = () => {
    if (numbers <= dolar) {
      htm.innerHTML = dolar
      text.innerHTML = '1'
    } else {
      numbers -= dolar
      n -= 1
      htm.innerHTML = numbers
      text.innerHTML = n
    }

  }
}
